import React, { Component } from "react";
import { jQuery as $ } from "jquery";
import "popper.js";
import "bootstrap/dist/js/bootstrap";
import "bootstrap/dist/css/bootstrap.css";

class Species extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <div
                        className="col-4 d-flex align-items-stretch"
                        style={{ height: "100%" }}
                    >
                        <div
                            id="common-name"
                            className="border"
                            style={{ height: "20%" }}
                        >
                            abc
                        </div>
                        <div
                            id="description"
                            className="border"
                            style={{ height: "20%" }}
                        >
                            abc
                        </div>
                        <div id="" className="border" style={{ height: "20%" }}>
                            abc
                        </div>
                        <div
                            id="food"
                            className="border"
                            style={{ height: "20%" }}
                        >
                            abc
                        </div>
                        <div
                            id="habitat"
                            className="border"
                            style={{ height: "20%" }}
                        >
                            abc
                        </div>
                    </div>
                    <div className="col-8" style={{ height: "100%" }}>
                        abc
                    </div>
                </div>
            </div>
        );
    }
}

export default Species;
